  return (
    <div>
      <h2>VISIBILITY FILTER</h2>
      <button>All</button>
      <button>Completed</button>
      <button>Not Completed</button>

      {todo}
    </div>
  );
};


const mapStateToProps = (state) => ({
  todos: getTodos(state),
});

export default connect(mapStateToProps)(VisibilityFilter);
